import React from 'react';

const Menu = ({items}) => {

  return (
    <div class="section-center">
      {items.map((menuItem) => {
        const {id,title,img,desc} = menuItem;
        return (
          <article key={id} className="menu-item">
            <img src={img} alt={title} className='photo' />
            <div class="item-info"></div>
          </article>
        );
      })}
    </div>
  );
};

export default Menu;
